import React from "react";
import { BrowserRouter } from "react-router-dom";
import { createRoot } from "react-dom/client";
import { Provider } from "react-redux";
import { store } from "../src/utils/store";
import App from "./App";
import reportWebVitals from "./reportWebVitals"; // Importez la fonction reportWebVitals

// Fonction d'initialisation et de rendu de l'application
function initializeApp() {
  // Sélectionnez l'élément racine du DOM où votre application sera rendue
  const rootElement = document.getElementById("root");
  const root = createRoot(rootElement);

  // Rendre l'application dans le DOM
  root.render(
    <Provider store={store}>
      <BrowserRouter>
        <App />
      </BrowserRouter>
    </Provider>
  );

  // Mesurez les performances de votre application et envoyez-les à la console
  reportWebVitals(console.log);
}

// Appelez la fonction d'initialisation
initializeApp();
